const Calendar = ()=>{
    
    let calendartemplate = {id:'userid',
                          dates:[
                            {day: '',
                             month: '',
                             year:'',
                             data:{
                                title:'',
                                text:''
                             }
                            }
                          ]
}


const calendar = []
    function createCalendar(){
        let i
        let d = 1
        let m = 1
        while(i<365){
            
            calendartemplate= {id:'userid',
            dates:[
              {day: `${stringify(d)}`,
               month: `${stringify(m)}`,
               year:'2022',
               data:{
                  title:'',
                  text:''
               }
              }
            ]
            }
    
            calendar.push(calendartemplate)
            
            if(d === 31){
                d = 0
                m++
                i++
            }
            d++
            i++
    
        }
    }

    return (<h1>Hello this is calendar</h1>)
}

export default Calendar
